import React from 'react'

import { Box,Typography,styled } from '@mui/material'

const Image = styled(Box)`
background : url(https://img.freepik.com/free-vector/blog-concept-illustration-idea-posting-sharing-following_613284-2970.jpg?size=626&ext=jpg&uid=R96296633&ga=GA1.1.31313145.1678804751&semt=ais) center/55% repeat-x ;
height:50vh;
width:100%


`

const Banner = () => {
  return (
    <Image>
        <Typography>Blog</Typography>
        <Typography>Share Your Knowledge</Typography>
    </Image>
  )
}

export default Banner
